import * as React from 'react';
import {Component} from 'react';
import { Text, View,Button,Image,List } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Ionicons from 'react-native-vector-icons/Ionicons';
import { SafeAreaView, FlatList, StyleSheet,  StatusBar } from 'react-native';
import firebaseApp from '../firebase.js'
import firebase from "firebase";






const Someone = firebase.initializeApp({
    apiKey: "AIzaSyAHPX4OE5uYV4dZgpgnMnXOBuIM-65OjM0",
    authDomain: "myfood-27388.firebaseapp.com",
    databaseURL: "https://myfood-27388-default-rtdb.firebaseio.com",
    projectId: "myfood-27388",
    storageBucket: "myfood-27388.appspot.com",
    messagingSenderId: "815017237760",
    appId: "1:815017237760:web:c887a3071112e89b0167e5",
    measurementId: "G-JTLHX0ZCM2"
  });
  





let Datp = Someone.firestore.collection("food").get();

let Item = ({ name }) => (
    <View style={styles.item}>
      <Text style={styles.title}>{name}</Text>
    </View>
  );
  
  const Separator = () => (
    <View style={styless.separator} />
  );

 export default class FBS extends Component {
     renderItem = ({ item }) => (
      <Item title={item.title} />
    );
    render() {
    return (
        <>
      <View >
        <SafeAreaView style={styless.container}>
        <View style={styless.fixToText}>
        </View>
        <FlatList
          data={Datp}
          renderItem={renderItem}
          keyExtractor={item => item.id}
        />
      </SafeAreaView>
      </View>
      </>
    );
    }
  }
  const styles = StyleSheet.create({
    container: {
      flex: 1,
      marginTop: StatusBar.currentHeight || 0,
    },
    item: {
      backgroundColor: '#f9c2ff',
      padding: 20,
      marginVertical: 8,
      marginHorizontal: 16,
    },
    title: {
      fontSize: 32,
    },
  });
